tion()\n                        self.scene:changeScene{map=\"knotholelookout\", fadeOutMusic=true, fadeInSpeed=0.2, fadeOutSpeed=0.2, enterDelay=3, nighttime=true}\n                    end)\n                }\n            end\n            GameState:removeItem(\"Carrot\")\n            return BlockPlayer {\n                self:hop(),\n                MessageBox {message = \"Tails: Wow! {p60}Thanks for this carrot guys!!\", sfx=\"choose\"},\n                Animate(self.sprite, \"joyright\"),\n                self:hop(),\n                Wait(0.5),\n                Ease(self.scene.objectLookup.SnowmanNose.sprite.color, 4, 255, 1),\n                MessageBox {message = \"Tails: Check him out now!\", sfx=\"levelup\"},\n                Wait(0.5),\n                Do(function() self.sprite:setAnimation(\"idledown\") end),\n                endAction,\n                Do(function()\n                    GameState:setFlag(\"ep4_tails_snowman_carrot\")\n                    self:refreshKeyHint()\n                end)\n            }\n        elseif not GameState:isFlagSet(\"ep4_tails_snowman_scarf\") and GameState:hasItem(\"Scarf\") then\n            local endAction = Action()\n            if GameState:isFlagSet(\"ep4_tails_snowman_hat\") and\n               GameState:isFlagSet(\"ep4_tails_snowman_carrot\")\n            then\n                endAction = Spawn(Serial {\n                    MessageBox {message = \"Tails: Thanks so much for helping me guys{p60}, this is the best snowman ever!\"},\n                    Do(function() self:refreshKeyHint() end)\n                })\n            end\n            GameState:removeItem(\"Scarf\")\n            return BlockPlayer {\n                self:hop(),\n                MessageBox {message = \"Tails: Wow! {p60}Thanks for this scarf guys!!\", sfx=\"choose\"},\n                Animate(self.sprite, \"joyright\"),\n                self:hop(),\n                Wait(0.5),\n                Ease(self.scene.objectLookup.SnowmanScarf.sprite.color, 4, 255, 1),\n                MessageBox {message = \"Tails: Check him out now!\", sfx=\"levelup\"},\n                Wait(0.5),\n                Do(function() self.sprite:setAnimation(\"idledown\") end),\n                endAction,\n                Do(function()\n                    GameState:setFlag(\"ep4_tails_snowman_scarf\")\n                    self:refreshKeyHint()\n                end)\n            }\n        elseif not GameState:isFlagSet(\"ep4_tails_snowman_hat\") and GameState:hasItem(\"Top Hat\") then\n            local endAction = Action()\n            if GameState:isFlagSet(\"ep4_tails_snowman_scarf\") and\n               GameState:isFlagSet(\"ep4_tails_snowman_carrot\")\n            then\n                endAction = Serial {\n                    MessageBox {message = \"Tails: Thanks so much for helping me guys{p60}, this is the best snowman ever!\"},\n                    Do(function() self:refreshKeyHint() end)\n                }\n            end\n            GameState:removeItem(\"Top Hat\")\n            return BlockPlayer {\n                self:hop(),\n                MessageBox {message = \"Tails: Wow! {p60}Thanks for this hat guys!!\", sfx=\"choose\"},\n                Animate(self.sprite, \"joyright\"),\n                self:hop(),\n                Wait(0.5),\n                Ease(self.scene.objectLookup.SnowmanHat.sprite.color, 4, 255, 1),\n                MessageBox {message = \"Tails: Check him out now!\", sfx=\"levelup\"},\n                Wait(0.5),\n                Do(function() self.sprite:setAnimation(\"idledown\") end),\n                endAction,\n                Do(function()\n                    GameState:setFlag(\"ep4_tails_snowman_hat\")\n                    self:refreshKeyHint()\n                end)\n            }\n        end\n        return BlockPlayer {\n            Do(function() self:facePlayer() end),\n            MessageBox {message = \"Tails: Hmmm... {p60}I still feel like he's missing somethin' though...\"},\n            Do(function()\n                self.sprite:setAnimation(\"idleright\")\n                self:refreshKeyHint()\n            end)\n        }\n    else\n        if GameState:hasItem(\"Lump of Coal\") and GameState:getItem(\"Lump of Coal\").count == 9 then\n            GameState:removeItem(\"Lump of Coal\")\n            return BlockPlayer {\n                self:hop(),\n                MessageBox {message = \"Tails: Wow! {p60}Thanks for the coal guys!!\", sfx=\"choose\"},\n                Animate(self.sprite, \"joyright\"),\n                self:hop(),\n                Wait(0.5),\n                Ease(self.scene.objectLookup.SnowmanFace.sprite.color, 4, 255, 1),\n                MessageBox {message = \"Tails: Check him out now!\", sfx=\"levelup\"},\n                Wait(0.5),\n                Do(function()\n                    self.sprite:setAnimation(\"idleright\")\n                    GameState:setFlag(\"ep4_tails_snowman_coal\")\n                    self:refreshKeyHint()\n                end)\n            }\n        end\n        return BlockPlayer {\n            Do(function() self:facePlayer() end),\n            MessageBox {message = \"Tails: Hey guys! {p60}I'm trying to make this snowman, but he's missing a few things...\"},\n            MessageBox {message = \"Tails: Could you help me find {h 9 Lumps of Coal}?\"},\n            Do(function()\n                self.sprite:setAnimation(\"idleright\")\n                self:refreshKeyHint()\n            end)\n        }\n    end\nend",
