            ["onInteract"] = "local Serial = require \"actions/Serial\"\nlocal Do = require \"actions/Do\"\nlocal MessageBox = require \"actions/MessageBox\"\nlocal Menu = require \"actions/Menu\"\nlocal BlockPlayer = require \"actions/BlockPlayer\"\nlocal PlayAudio = require \"actions/PlayAudio\"\nlocal Wait = require \"actions/Wait\"\nlocal Ease = require \"actions/Ease\"\nlocal Parallel = require \"actions/Parallel\"\nlocal Animate = require \"actions/Animate\"\n\nlocal Transform = require \"util/Transform\"\nlocal Layout = require \"util/Layout\"\n\nlocal NPC = require \"object/NPC\"\n\nreturn function(self)\n    if GameState:isFlagSet(\"ep4_tails_snowman\") then\n        return BlockPlayer {\n            MessageBox {message = \"Fleet: \"},\n            Do(function() self:refreshKeyHint() end)\n        }\n    else\n        return BlockPlayer {\n            MessageBox {message = \"Logan: Princess, this is not normal! {p60}We need to figure out what caused this snow storm in the middle of\\nsummer!\"},\n            MessageBox {message = \"Sally: Don't worry Logan, Leon and I are investigating. {p60}Just take advantage of this winter\\nwonderland for today and have fun with the others!\"},\n            MessageBox {message = \"Logan: B-{p30}But-{p30}But--\", closeAction=Wait(1)},\n            MessageBox {message = \"Leon: Listen to the Princess, Logan.\"},\n            MessageBox {message = \"Logan: Ugh!\"},\n            Do(function() self:refreshKeyHint() end)\n        }\n    end\nend",
